import React from 'react';
import '../App.css';
import Course from './Course';

class CourseRecommendor extends React.Component{
    getCourses() {
        let courses = [];

        return courses;
      }

      render() {
        return (

          <div class="container-fluid">
            <div class="row">
              <div class="col-lg-6" >{this.getCourses()}</div>
              <div class="col-lg-6" >{this.getCourses()}</div>
            </div>
          </div>

        )
      }
}


export default CourseRecommendor
